import{_ as l,C as t,c as i,o as s,an as n,G as e}from"./chunks/framework.FiaHILad.js";const x=JSON.parse('{"title":"蒙版","description":"","frontmatter":{"breadcrumbs":[{"title":"Continue Project","link":"/FastAsyncWorldEdit"},{"title":"蒙版","link":"/FastAsyncWorldEdit/command-utilties.masks"}]},"headers":[],"relativePath":"FastAsyncWorldEdit/command-utilties.masks.md","filePath":"FastAsyncWorldEdit/command-utilties.masks.md"}'),d={name:"FastAsyncWorldEdit/command-utilties.masks.md"};function h(c,a,g,u,p,b){const r=t("NolebaseGitContributors"),o=t("NolebaseGitChangelog");return s(),i("div",null,[a[0]||(a[0]=n('<h1 id="蒙版" tabindex="-1">蒙版 <a class="header-anchor" href="#蒙版" aria-label="Permalink to &quot;蒙版&quot;">​</a></h1><h2 id="介绍" tabindex="-1">介绍 <a class="header-anchor" href="#介绍" aria-label="Permalink to &quot;介绍&quot;">​</a></h2><p>当前页面正等待改进。</p><h2 id="蒙版-1" tabindex="-1">蒙版 <a class="header-anchor" href="#蒙版-1" aria-label="Permalink to &quot;蒙版&quot;">​</a></h2><p>若要了解 WorldEdit 提供的基础蒙版，请<a href="https://worldedit.enginehub.org/en/latest/usage/general/masks/" target="_blank" rel="noreferrer">点此</a>（<a href="/WorldEdit/index">站内跳转点此</a>）访问。</p><p>蒙版为编辑中限制的方块类型。如，只允许替换上方是石头的方块。全局蒙版对所有编辑生效，笔刷蒙版则只对当前笔刷生效。</p><h2 id="格式" tabindex="-1">格式 <a class="header-anchor" href="#格式" aria-label="Permalink to &quot;格式&quot;">​</a></h2><h3 id="方块" tabindex="-1">方块 <a class="header-anchor" href="#方块" aria-label="Permalink to &quot;方块&quot;">​</a></h3><p>输入方块名称或 ID（如 <code>stone</code>）。</p><h3 id="多蒙版" tabindex="-1">多蒙版 <a class="header-anchor" href="#多蒙版" aria-label="Permalink to &quot;多蒙版&quot;">​</a></h3><p>使用 <code>,</code>（或）、<code>&amp;</code>（和）分隔多个蒙版，如 <code>grass_block,$desert</code></p><h3 id="参数" tabindex="-1">参数 <a class="header-anchor" href="#参数" aria-label="Permalink to &quot;参数&quot;">​</a></h3><p>蒙版参数应当以方括号标注，如 <code>#offset[0][5][3]</code></p><h2 id="设置蒙版" tabindex="-1">设置蒙版 <a class="header-anchor" href="#设置蒙版" aria-label="Permalink to &quot;设置蒙版&quot;">​</a></h2><p>权限：<code>worldedit.global-mask</code><br> 描述：该命令对所有 WorldEdit 编辑操作施加蒙版。该命令蒙版基于任意目标方块（即世界上的所有方块）。</p><p>权限：<code>worldedit.global-mask</code><br> 描述：全局源蒙版对你所做出的所有编辑，以及基于源方块（如剪贴板内的方块）的蒙版生效。</p><p>权限：<code>worldedit.brush.options.mask</code><br> 描述：为笔刷设置目标蒙版。</p><p>权限：<code>worldedit.brush.options.mask</code> 描述：设置笔刷源蒙版。</p><h2 id="蒙版列表" tabindex="-1">蒙版列表 <a class="header-anchor" href="#蒙版列表" aria-label="Permalink to &quot;蒙版列表&quot;">​</a></h2><h3 id="offset-dx-dy-dz-蒙版" tabindex="-1">#offset &lt;dx&gt; &lt;dy&gt; &lt;dz&gt; &lt;蒙版&gt; <a class="header-anchor" href="#offset-dx-dy-dz-蒙版" aria-label="Permalink to &quot;\\#offset \\&lt;dx\\&gt; \\&lt;dy\\&gt; \\&lt;dz\\&gt; \\&lt;蒙版\\&gt;&quot;">​</a></h3><p><strong>描述：</strong> 偏移指定蒙版</p><h3 id="几率" tabindex="-1">% &lt;几率&gt; <a class="header-anchor" href="#几率" aria-label="Permalink to &quot;% \\&lt;几率\\&gt;&quot;">​</a></h3><p><strong>描述：</strong> 几率生效</p><h3 id="id" tabindex="-1">#id <a class="header-anchor" href="#id" aria-label="Permalink to &quot;\\#id&quot;">​</a></h3><p><strong>描述：</strong> 限制至初始方块对应的 ID</p><h3 id="existing" tabindex="-1">#existing <a class="header-anchor" href="#existing" aria-label="Permalink to &quot;\\#existing&quot;">​</a></h3><p><strong>描述：</strong> 限制为非空气方块。</p><h3 id="data" tabindex="-1">#data <a class="header-anchor" href="#data" aria-label="Permalink to &quot;\\#data&quot;">​</a></h3><p><strong>描述：</strong> 限制至初始方块包含的数据</p><h3 id="最小值-最大值" tabindex="-1">{ &lt;最小值&gt; &lt;最大值&gt; <a class="header-anchor" href="#最小值-最大值" aria-label="Permalink to &quot;{ \\&lt;最小值\\&gt; \\&lt;最大值\\&gt;&quot;">​</a></h3><p><strong>描述：</strong> 限制至初始方块指定的范围</p><h3 id="surface" tabindex="-1">#surface <a class="header-anchor" href="#surface" aria-label="Permalink to &quot;\\#surface&quot;">​</a></h3><p><strong>描述：</strong> 限制至表面方块（任意暴露在空气中的方块）</p><h3 id="表达式" tabindex="-1">= &lt;表达式&gt; <a class="header-anchor" href="#表达式" aria-label="Permalink to &quot;= \\&lt;表达式\\&gt;&quot;">​</a></h3><p><strong>描述：</strong> 表达式蒙版</p><h3 id="蒙版-2" tabindex="-1">! &lt;蒙版&gt; <a class="header-anchor" href="#蒙版-2" aria-label="Permalink to &quot;! \\&lt;蒙版\\&gt;&quot;">​</a></h3><p><strong>描述：</strong> 反转指定蒙版的效果</p><h3 id="生物群系" tabindex="-1">$ &lt;生物群系&gt; <a class="header-anchor" href="#生物群系" aria-label="Permalink to &quot;$ \\&lt;生物群系\\&gt;&quot;">​</a></h3><p><strong>描述：</strong> 只在指定生物群系内操作。可用的生物群系列表请输入命令 <code>//biomelist</code> 查看。</p><h3 id="region" tabindex="-1">#region <a class="header-anchor" href="#region" aria-label="Permalink to &quot;\\#region&quot;">​</a></h3><p><strong>描述：</strong> 只在选区内改动</p><h3 id="蒙版-min-1-max-8" tabindex="-1">~ &lt;蒙版&gt; [min=1] [max=8] <a class="header-anchor" href="#蒙版-min-1-max-8" aria-label="Permalink to &quot;~ \\&lt;蒙版\\&gt; [min=1] [max=8]&quot;">​</a></h3><p><strong>描述：</strong> 限制至与指定方块一定范围内的相邻方块</p><h3 id="最小值-最大值-1" tabindex="-1">/ &lt;最小值&gt; &lt;最大值&gt; <a class="header-anchor" href="#最小值-最大值-1" aria-label="Permalink to &quot;/ \\&lt;最小值\\&gt; \\&lt;最大值\\&gt;&quot;">​</a></h3><p><strong>描述：</strong> 限制至指定地形角度<br> 标志 <code>-o</code> 表示仅覆盖。</p><ul><li>示例：<code>/[0d][45d]</code><br> 解释：允许任意 0 至 45 度的相邻方块。</li><li>示例：<code>/[3][20]</code><br> 解释：允许任意 3 至 20 格深的相邻方块。</li></ul><h3 id="dregion" tabindex="-1">#dregion <a class="header-anchor" href="#dregion" aria-label="Permalink to &quot;\\#dregion&quot;">​</a></h3><p><strong>描述：</strong> 限制至玩家选区内</p><h3 id="xaxis" tabindex="-1">#xaxis <a class="header-anchor" href="#xaxis" aria-label="Permalink to &quot;\\#xaxis&quot;">​</a></h3><p><strong>描述：</strong> 限制至初始 X 轴</p><h3 id="liquid" tabindex="-1">#liquid <a class="header-anchor" href="#liquid" aria-label="Permalink to &quot;\\#liquid&quot;">​</a></h3><p><strong>描述：</strong> 限制至流体方块</p><h3 id="true" tabindex="-1">true <a class="header-anchor" href="#true" aria-label="Permalink to &quot;true&quot;">​</a></h3><p><strong>描述：</strong> 总是返回 true</p><h3 id="false" tabindex="-1">false <a class="header-anchor" href="#false" aria-label="Permalink to &quot;false&quot;">​</a></h3><p><strong>描述：</strong> 总是返回 false</p><h3 id="蒙版-3" tabindex="-1">&gt; &lt;蒙版&gt; <a class="header-anchor" href="#蒙版-3" aria-label="Permalink to &quot;\\&gt; \\&lt;蒙版\\&gt;&quot;">​</a></h3><p><strong>描述：</strong> 处于指定方块上</p><h3 id="wall" tabindex="-1">#wall <a class="header-anchor" href="#wall" aria-label="Permalink to &quot;\\#wall&quot;">​</a></h3><p><strong>描述：</strong> 限制为墙壁（任意横四面暴露的方块）</p><h3 id="zaxis" tabindex="-1">#zaxis <a class="header-anchor" href="#zaxis" aria-label="Permalink to &quot;\\#zaxis&quot;">​</a></h3><p><strong>描述：</strong> 限制为初始 Z 轴</p><h3 id="yaxis" tabindex="-1">#yaxis <a class="header-anchor" href="#yaxis" aria-label="Permalink to &quot;\\#yaxis&quot;">​</a></h3><p><strong>描述：</strong> 限制为初始 Y 轴</p><h3 id="蒙版-4" tabindex="-1">&lt; &lt;蒙版&gt; <a class="header-anchor" href="#蒙版-4" aria-label="Permalink to &quot;\\&lt; \\&lt;蒙版\\&gt;&quot;">​</a></h3><p><strong>描述：</strong> 处于指定方块下</p><h3 id="simplex-scale-10-min-0-max-100" tabindex="-1">#simplex &lt;scale=10&gt; &lt;min=0&gt; &lt;max=100&gt; <a class="header-anchor" href="#simplex-scale-10-min-0-max-100" aria-label="Permalink to &quot;\\#simplex \\&lt;scale=10\\&gt; \\&lt;min=0\\&gt; \\&lt;max=100\\&gt;&quot;">​</a></h3><p><strong>描述：</strong> 对蒙版使用简单噪声函数</p><h3 id="solid" tabindex="-1">#solid <a class="header-anchor" href="#solid" aria-label="Permalink to &quot;\\#solid&quot;">​</a></h3><p><strong>描述：</strong> 限制至固体方块</p><h3 id="surfaceangle-最小值-最大值-深度-材料名" tabindex="-1">#surfaceangle[最小值][最大值][深度] (材料名) <a class="header-anchor" href="#surfaceangle-最小值-最大值-深度-材料名" aria-label="Permalink to &quot;\\#surfaceangle[最小值][最大值][深度] (材料名)&quot;">​</a></h3><p><strong>描述：</strong> 替换地表的方块</p>',72)),e(r),e(o)])}const q=l(d,[["render",h]]);export{x as __pageData,q as default};
